import SneakerCard from "./SneakerCard"
import React from 'react';

function SneakerList({sneaker, currentUser, handleComments}){
const sneakersToMap =sneaker.slice(0,20)

const sneakerComponent = sneakersToMap.map(sneaker =>{
    return <SneakerCard
    sneaker={sneaker}
    currentUser={currentUser}
    handleComments={handleComments}
    key={sneaker.id}
    />

})


return(
<div className="SneakerLists">

 {sneakerComponent}
</div>


);

}


export default SneakerList;
